    "2014-10-28T20:54:57.465120",nt"name": "bathymetry-offshore-san-gregorio-california3949e",nt"isopen":
    false,nt"url": null,nt"notes": "This part of SIM 3306 presents data for
    the bathymetry and shaded-relief maps (see sheet 1 and 2, SIM 3306) of the Offshore
    of San Gregorio map area, California. The raster data file is included in "Bathymetry_OffshoreSanGregorio.zip,"
    which is accessible from http://pubs.usgs.gov/ds/781/OffshoreSanGregorio/data_catalog_OffshoreSanGregorio.html.
    The bathymetry and shaded-relief maps of Offshore San Gregorio, California, were
    generated from bathymetry data collected by Fugro Pelagos and by California State
    University, Monterey Bay (CSUMB). Mapping was completed in 2006 and 2007, using
    a combination of 400-kHz Reson 7125 and 244-kHz Reson 8101 multibeam echosounders.
    These mapping missions combined to collect bathymetry (sheets 1, 2) from about the
    10-m isobath to beyond the 3-nautical-mile limit of Californiau0150s State Waters.",nt"license_title":
